SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://dbpedia.org/resource/"The_Take_Over,_the_Breaks_Over"> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://dbpedia.org/resource/"The_Take_Over,_the_Breaks_Over"> }
}

